import React from "react";
import catHeader from "../../images/cat-header.jpg";

const Navbar = () => {
  return (
    <div className="mx-3" >
      <h1 className="text-3xl font-bold bg-orange-300 ">CatLy</h1>
      <ul>
        <li>Home</li>
        <li>About Us</li>
        <li>Contact</li>
      </ul>
     <img src={catHeader} alt="Cat Header" />
    </div>
  );
};

export default Navbar;
